-protection\\\': \\\'1; mode=block\\\', \\\'x-content-type-options\\\': \\\'nosniff\\\', \\\'content-encoding\\\': \\\'gzip\\\', \\\'transfer-encoding\\\': \\\'chunked\\\', \\\'expires\\\': \\\'Fri, 14 Nov 2014 10:16:13 GMT\\\', \\\'server\\\': \\\'GSE\\\', \\\'last-modified\\\': \\\'Fri, 14 Nov 2014 09:59:07 GMT\\\', \\\'connection\\\': \\\'close\\\', \\\'etag\\\': \\\'QYpCzwW0pbk23QHi99KLPCtxUXU\\\', \\\'cache-control\\\': \\\'private, max-age=0\\\', \\\'date\\\': \\\'Fri, 14 Nov 2014 10:16:13 GMT\\\', \\\'content-type\\\': \\\'text/xml; charset=UTF-8\\\'}, \\\'etag\\\': u\\\'QYpCzwW0pbk23QHi99KLPCtxUXU\\\', \\\'href\\\': u\\\'http://feeds.feedburner.com/TheTechnicalTraders?format=xml\\\', \\\'version\\\': u\\\'rss20\\\', \\\'entries\\\': [{\\\'summary_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/TheTechnicalTraders?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'Credit cards &#8216;were nigella&#8217;s christian loub [&#8230;]\\\', \\\'language\\\': None}, \\\'published_parsed\\\': time.struct_time(tm_year=2014, tm_mon=11, tm_mday=12, tm_hour=7, tm_min=27, tm_sec=25, tm_wday=2, tm_yday=316, tm_isdst=0), \\\'links\\\': [{\\\'href\\\': u\\\'http://feedproxy.google.com/~r/TheTechnicalTraders/~3/t7T741MSdEw/\\\', \\\'type\\\': u\\\'text/html\\\', \\\'rel\\\': u\\\'alternate\\\'}, {\\\'url\\\': u\\\'\\\', \\\'length\\\': u\\\'\\\', \\\'type\\\': u\\\'\\\', \\\'rel\\\': u\\\'enclosure\\\'}], \\\'title\\\': u\\\'deal of work in that pas cher ralph lauren sense\\\', \\\'feedburner_origlink\\\': u\\\'http://www.thetechnicaltraders.com/deal-of-work-in-that-pas-cher-ralph-lauren-sense/?utm_source=rss&utm_medium=rss&utm_campaign=deal-of-work-in-that-pas-cher-ralph-lauren-sense\\\', \\\'authors\\\': [{}], \\\'slash_comments\\\': u\\\'0\\\', \\\'comments\\\': u\\\'http://www.thetechnicaltraders.com/deal-of-work-in-that-pas-cher-ralph-lauren-sense/#comments\\\', \\\'summary\\\': u\\\'Credit cards &#8216;were nigella&#8217;s christian loub [&#8230;]\\\', \\\'content\\\': [{\\\'base\\\': u\\\'http://feeds.feedburner.com/TheTechnicalTraders?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'<p><!-- Start Shareaholic LikeButtonSetTop Automatic --><!-- End Shareaholic LikeButtonSetTop Automatic -->\\\\n<p>Credit cards &#8216;were nigella&#8217;s <a href=\\\"http://www.yali.com.au/\\\" title=\\\"christian louboutin shoes\\\">christian louboutin shoes</a> idea&#8217; from daily echo Charles saatchi has told a court it was his ex wife nigella lawson&#8217;s idea to let their personal assistants have company credit cards. The millionaire art dealer, who went through a high profile divorce from the tv cook earlier this year, said he was&#8221;Very fond&#8221;Of italian sisters francesca and elisabetta grillo, who are accused of <a href=\\\"http://www.lasaliera.it/\\\" title=\\\"ralph lauren outlet online\\\">ralph lauren outlet online</a> using credit cards loaned to them by the celebrity couple to spend more than 685, 000 on themselves. It is alleged that the two women lived the&#8221;High life&#8221;, spending the money on designer clothes and handbags from Louis Vuitton, Christian Dior and Vivienne Westwood. Asked by prosecutor jane carpenter who decided that the defendants should have credit cards, mr saatchi said: &#8220;My ex wife, nigella. &#8221; Mr saatchi told jurors at isleworth crown court in west london that the credit card bills were paid by his company conarco partnership before he reimbursed it from his own personal account. &#8220;I&#8217;m pretty certain the company pays off everything and bills me and i pay back the company for anything that&#8217;s personal,&#8221;He said. He told the court the sisters were originally employed as a nanny by miss lawson during her marriage to her late husband, john diamond. &#8220;The children adored them and nigella was very fond of them and i was very fond of them and we didn&#8217;t want them to go so they stayed on as housekeepers and general assistants,&#8221;Mr saatchi said. Saatchi, who had to repeatedly be asked to raise his voice for everyone in the packed court room to hear, outlined what was expected of the sisters. &#8220;Housekeeping, shopping, doing <a href=\\\"http://www.listgb.co.uk/\\\" title=\\\"cheap louis vuitton\\\">cheap louis vuitton</a> the laundry, organising everyone in the household,&#8221;He said. Asked by ms carpenter if the defendants did anything related to his own business interests, the art dealer said: &#8220;If i wanted something collected and there was nobody else.I think not a great deal of work in that <a href=\\\"http://www.edolus.com/\\\" title=\\\"pas cher ralph lauren\\\">pas cher ralph lauren</a> sense. &#8221; &#8220;They were on my company&#8217;s payroll and then i would reimburse the company for their wages privately,&#8221;He added. Saatchi, who asked if he could sit <a href=\\\"http://www.spss.co.uk/\\\" title=\\\"ralph lauren sale uk\\\">ralph lauren sale uk</a> down to give his evidence, repeatedly apologised for not speaking loudly enough. &#8220;I have a quiet voice.I&#8217;ll do you a better effort. &#8221; Wearing a dark blue suit and black loafers, he shuffled into the courtroom and took the oath in a hushed voice before beginning his evidence just before the lunch break. Saatchi said the defendants had a&#8221;Very close&#8221;Relationship with the children. He agreed with the prosecution that they accompanied the children on holidays and were permitted to live rent free. He said he did not know if a formal employment contract had ever been signed by the two women. Saatchi recalled a&#8221;Peculiar&#8221;Instance one morning when he received a phonecall from a taxi company asking about a booking to berkshire, when he was not aware of anyone in his household travelling there. &#8220;I said&#8217;are you sure you&#8217;ve got this right?&#8217; &#8220;I said &#8216;what name is it booked under?&#8217; And they said &#8216;Grillo&#8217;,&#8221;He to