 few inches of each color dangling on both sides.They will add color and style to what might have <a href=\\\"http://www.lasaliera.it/\\\" title=\\\"ralph lauren polo online\\\">ralph lauren polo online</a> been an ordinary handbag. Use leather bands to cover and repair purse handles that end up cracked and worn.Buy leather strips online, or visit a local leather supply store.Tie the first leather strip to the handle hardware, and begin tightly wrapping the first damaged handle.Securely tie it to the hardware on the other side, but do not trim off the excess leather yet.Wrap it with a second strip using the same method, and cover the first row <a href=\\\"http://www.yali.com.au/\\\" title=\\\"christian louboutin australia\\\">christian louboutin australia</a> of seams.Create fringe by vertically clipping the excess leather.Trim the fringe across as necessary.The leather strips will give the handles a new lease on life while giving the purse a whole new look. String <a href=\\\"http://www.edolus.com/\\\" title=\\\"ralph lauren pas cher homme\\\">ralph lauren pas cher homme</a> beads and wrap them around cracked purse handles I love glass beads, and i use them often when crafting.When i had to repair and cover my cracked purse handles, i decided to use beautiful glass beads.I purchased durable clear string, and i filled several strands with gorgeous black and red glass beads.I wrapped the cracked vinyl handles tightly, and i securely tied the strings to the existing hardware.She won the people media award from associated content in 2009 as well as numerous a.Beginner&#8217;s sewing tips:How to make spaghetti strapsit can be somewhat challenging to make spaghetti straps if you&#8217;re a beginner but a few tips will help you make the perfect straps every time!The 4 must have louis vuitton handbags for fall 2010four the of the fiercest looking handbags by lv or louis vuitton for fall 2010.They range from the iconic to trendy to casual to classic.</p>\\\\n<div class=\\\"