'label\\\': None}]}, {\\\'summary_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/TheTechnicalTraders?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'Counterfeit alert over web cheap ralph lauren t shirts  [&#8230;]\\\', \\\'language\\\': None}, \\\'published_parsed\\\': time.struct_time(tm_year=2014, tm_mon=11, tm_mday=5, tm_hour=7, tm_min=39, tm_sec=42, tm_wday=2, tm_yday=309, tm_isdst=0), \\\'links\\\': [{\\\'href\\\': u\\\'http://feedproxy.google.com/~r/TheTechnicalTraders/~3/YUhxuAdL6Tk/\\\', \\\'type\\\': u\\\'text/html\\\', \\\'rel\\\': u\\\'alternate\\\'}, {\\\'url\\\': u\\\'\\\', \\\'length\\\': u\\\'\\\', \\\'type\\\': u\\\'\\\', \\\'rel\\\': u\\\'enclosure\\\'}], \\\'title\\\': u\\\'fake goods from ralph lauren online the genuine\\\', \\\'feedburner_origlink\\\': u\\\'http://www.thetechnicaltraders.com/fake-goods-from-ralph-lauren-online-the-genuine/?utm_source=rss&utm_medium=rss&utm_campaign=fake-goods-from-ralph-lauren-online-the-genuine\\\', \\\'authors\\\': [{}], \\\'slash_comments\\\': u\\\'0\\\', \\\'comments\\\': u\\\'http://www.thetechnicaltraders.com/fake-goods-from-ralph-lauren-online-the-genuine/#comments\\\', \\\'summary\\\': u\\\'Counterfeit alert over web cheap ralph lauren t shirts  [&#8230;]\\\', \\\'content\\\': [{\\\'base\\\': u\\\'http://feeds.feedburner.com/TheTechnicalTraders?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'<p><!-- Start Shareaholic LikeButtonSetTop Automatic --><!-- End Shareaholic LikeButtonSetTop Automatic -->\\\\n<p>Counterfeit alert over web <a href=\\\"http://www.spss.co.uk/\\\" title=\\\"cheap ralph lauren t shirts\\\">cheap ralph lauren t shirts</a> bargains Online christmas shoppers are being warned to take extra care over their internet bargains after border officers reported seizing million in counterfeit goods. The uk border force said it has seized 6, 000 parcels and packets at an international postal depot since the start of october. Among the goods seized were fake armani and cartier watches, jewellery and counterfeit clothing and footwear, including ugg boots, louis vuitton handbags and nike sportswear.Also among the items were boxes of beats by <a href=\\\"http://www.edolus.com/\\\" title=\\\"ralph lauren polo pas cher\\\">ralph lauren polo pas cher</a> dr dre headphones. In all, 58, 000 items have been intercepted at the coventry international hub, and almost all were destined for individual uk addresses most likely people trying to buy christmas presents at a bargain price, say border officers. Seizures have <a href=\\\"http://www.listgb.co.uk/\\\" title=\\\"louis vuitton sale uk\\\">louis vuitton sale uk</a> spiked in the run up to christmas. Border officers are permanently based at the massive national postal distribution centre and use scanning equipment to sort the fake goods from <a href=\\\"http://www.lasaliera.it/\\\" title=\\\"ralph lauren online\\\">ralph lauren online</a> the genuine. All the counterfeit goods are destroyed, with the buyers likely to lose their money.Border officers are not responsible for telling the buyers their goods have been seized. However, the buyers details are all passed to the brand name companies whose goods they ordered, so they can then be given the chance to buy the genuine article instead. Home office minister mark harper said cheap counterfeits were a threat to the british economy, and at worst unsafe. &#8220;Shoppers should take great care when buying online to avoid being ripped off, and further fuelling this illegal trade,&#8221;He said. Ria baxendale, border force assistant director at coventry international hub, said: &#8220;It is easy to think you are getting a bargain, but our message is that if something appears too good to be true, it probably is.You could end up out of pocket but <a href=\\\"http://www.yali.com.au/\\\" title=\\\"cheap christian louboutin australia\\\">cheap christian louboutin australia</a> even worse, you could end up with a fake product that is inferior and could be harmful or unsafe. &#8220;</p>\\\\n<div class=\\\"shr-publisher-1401\\\"></div>\\\\n<p><!-- Start Shareaholic LikeButtonSetBottom Automatic -->\\\\n<div style=\\\"clear: both; height: 3px; width: 100%;\\\"></div>\\\\n<div class=\\\"shareaholic-like-buttonset\\\" style=\\\"float: none; height: 30px;\\\"><a class=\\\"shareaholic-fbsend\\\"></a><a class=\\\"shareaholic-googleplusone\\\"></a></div>\\\\n<div style=\\\"clear: both; height: 3px; width: 100%;\\\"></div>\\\\n<p><!-- End Shareaholic LikeButtonSetBottom Automatic --><!-- Start Shareaholic Recommendations Automatic --><!-- End Shareaholic Recommendations Automatic --><img height=\\\"1\\\" src=\\\"http://feeds.feedburner.com/~r/TheMarketTrendForecast/~4/VCiC1-mTWwU\\\" width=\\\"1\\\" /></p>\\\\n<div class=\\\"feedflare\\\">\\\\n<a href=\\\"http://feeds.feedburner.com/~ff/TheTechnicalTraders?a=YUhxuAdL6Tk:1K3XRAdMLVA:yIl2AUoC8zA\\\"><img border=\\\"0\\\" src=\\\"http://feeds.feedburner.com/~ff/TheTechnicalTraders?d=yIl2AUoC8zA\\\" /></a> <a href=\\\"http://feeds.feedburner.com/~ff/TheTechnicalTraders?a=YUhxuAdL6Tk:1K3XRAdMLVA:qj6IDK7rITs\\\"><img border=\\\"0\\\" src=\\\"http://feeds.feedburner.com/~ff/TheTechnicalTraders?d=qj6IDK7rITs\\\" /></a>\\\\n</div><img height=\\\"1\\\" src=\\\"http://feeds.feedburner.com/~r/TheTechnicalTraders/~4/YUhxuAdL6Tk\\\" width=\\\"1\\\" />\\\', \\\'language\\\': None}], \\\'guidislink\\\': False, \\\'title_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/TheTechnicalTraders?format=xml\\\', \\\'type\\\': u\\\'text/plain\\\', \\\'value\\\': u\\\'fake goods from ralph lauren online the genuine\\\', \\\'language\\\': None}, \\\'link\\\': u\\\'http://feedproxy.google.com/~r/TheTechnicalTraders/~3/YUhxuAdL6Tk/\\\', \\\'author\\\': u\\\'admin-test\\\', \\\'published\\\': u\\\'Wed, 05 Nov 2014 07:39:42 +0000\\\', \\\'author_detail\\\': {\\\'name\\\': u\\\'admin-test\\\'}, \\\'wfw_commentrss\\\': u\\\'http://www.thetechnicaltraders.com/fake-good