\', \\\'type\\\': u\\\'text/plain\\\', \\\'value\\\': u\\\'TechRadar: latest computing news\\\', \\\'language\\\': None}, \\\'link\\\': u\\\'http://www.techradar.com/rss/news/computing\\\', \\\'published\\\': u\\\'Thu, 13 Nov 2014 23:58:22 GMT\\\', \\\'rights_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/plain\\\', \\\'value\\\': u\\\'Copyright \\\\xa9Future Publishing\\\', \\\'language\\\': None}, \\\'updated_parsed\\\': time.struct_time(tm_year=2014, tm_mon=11, tm_mday=13, tm_hour=23, tm_min=58, tm_sec=22, tm_wday=3, tm_yday=317, tm_isdst=0)}, \\\'status\\\': 200, \\\'updated\\\': \\\'Fri, 14 Nov 2014 10:04:01 GMT\\\', \\\'updated_parsed\\\': time.struct_time(tm_year=2014, tm_mon=11, tm_mday=14, tm_hour=10, tm_min=4, tm_sec=1, tm_wday=4, tm_yday=318, tm_isdst=0), \\\'encoding\\\': u\\\'UTF-8\\\', \\\'bozo\\\': 0, \\\'headers\\\': {\\\'alternate-protocol\\\': \\\'80:quic,p=0.01\\\', \\\'x-xss-protection\\\': \\\'1; mode=block\\\', \\\'x-content-type-options\\\': \\\'nosniff\\\', \\\'content-encoding\\\': \\\'gzip\\\', \\\'transfer-encoding\\\': \\\'chunked\\\', \\\'expires\\\': \\\'Fri, 14 Nov 2014 10:16:06 GMT\\\', \\\'server\\\': \\\'GSE\\\', \\\'last-modified\\\': \\\'Fri, 14 Nov 2014 10:04:01 GMT\\\', \\\'connection\\\': \\\'close\\\', \\\'etag\\\': \\\'UT3WGrAD0wSj4rsdWtR8w5cMkWg\\\', \\\'cache-control\\\': \\\'private, max-age=0\\\', \\\'date\\\': \\\'Fri, 14 Nov 2014 10:16:06 GMT\\\', \\\'content-type\\\': \\\'text/xml; charset=UTF-8\\\'}, \\\'etag\\\': u\\\'UT3WGrAD0wSj4rsdWtR8w5cMkWg\\\', \\\'href\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'version\\\': u\\\'rss20\\\', \\\'entries\\\': [{\\\'summary_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'<img alt=\\\"Updated: Black Friday Deals UK 2014: get mega deals on tech this month\\\" src=\\\"http://cdn.mos.techradar.com/art/techradar/Black%20Friday%20Deals%20UK/PNG/Black-friday-deals-uk-470-75.png\\\" /><p>In the US and Canada, Black Friday needs no introduction: it\\\\\\\'s a time for big sales, crazy prices and CCTV footage showing shoppers knocking lumps out of each other.</p><p>But it\\\\\\\'s becoming a huge deal in the UK now as well, with some of the biggest retailers like Amazon slashing their prices for one day only.</p><p>And the best news? TechRadar will be busy finding all the best deals on phones, headphones, speakers, cameras, games and more, and posting them here so you can find them more easily.</p><p>So what is Black Friday, what is Cyber Monday, and where can you find the best Black Friday deals in the UK?</p><h3>What is Black Friday?</h3><p>Black Friday is the first Friday after Thanksgiving, and it represents a perfect storm for retailers: many people in the US have the day off, and as a result it\\\\\\\'s been the busiest shopping day of the year for nearly a decade.</p><p>To make things even busier, many retailers now offer some of their best sale bargains on Black Friday. Even Apple joins in.</p><h3>When is Black Friday?</h3><p>That depends on when you\\\\\\\'re reading this. If it\\\\\\\'s 2014, Black Friday is Friday 28 November. If it\\\\\\\'s 2015, it\\\\\\\'s Friday 27 November. And if it\\\\\\\'s 2013, you\\\\\\\'ve been asleep for a year. The things you\\\\\\\'ve missed!</p><h3>How did Black Friday get its name?</h3><p>Take your pick: some say it\\\\\\\'s the day that retailers\\\\\\\' profits finally move into the black, although Wikipedia reckons that the true origin of the term comes from Philadelphia where it referred to the disruptive pedestrian and vehicle traffic that occurred during the holiday. </p><h3>Is it really as big a deal as it seems?</h3><p>Yes it is. Every year there are reports of fisticuffs as bargain-crazed shoppers beat each other up, partly because of the practice of using \\\"doorbusters\\\" - amazing and excruciatingly limited deals to attract as many customers as possible. US-based retailers such as Amazon are now keen to make it a tradition here in the UK.</p><h3>Is Black Friday connected to Cyber Monday?</h3><p>Cyber Monday is the Monday immediately after Black Friday, and it was invented in 2005 in an attempt to create an online equivalent of Black Friday. What this has resulted in now, is an entire 4-day weekend of hot deals both in store and online.</p><h3>What\\\\\\\'s TechRadar doing for Black Friday?</h3><p>No one likes a tech bargain more than TechRadar! And we don\\\\\\\'t want to keep them all to ourselves.</p><p>So we\\\\\\\'ll be beavering away tirelessly all weekend to constantly bring you the hottest deals as they go live online. You\\\\\\\'ll need to keep your wits about you though, because many deals only last for an hour or until stocks run out. So you need to be quick off the mark - and we\\\\\\\'ll be on hand to make it as easy for you as possible. </p><p>Tune in to TechRadar on November 28th, 29th, 30th and December 1st to get at the hot deals first!</p><h3>Where do retailers put their best Black Friday deals?</h3><p>Don\\\\\\\'t you know that patience is a virtue?! It\\\\\\\'s not Black Friday yet, but okay - we\\\\\\\'ve put together a list of retailer\\\\\\\'s Black Friday pages so that you can take a look now and see what it\\\\\\\'s all about. We\\\\\\\'ll be adding more soon, and of course, this page on TechRadar will be the place to be with a curated list of all the best deals!</p><p><a href=\\\"http://www.amazon.co.uk/Black-Friday-Deals/b/?_encoding=UTF8&#38;camp=1634&#38;creative=19450&#38;linkCode=ur2&#38;node=161428031&#38;tag=futurepublish_trd_bf-21&#38;linkId=K7ZNDE6BPTS2ETEQ\\\" rel=\\\"nofollow\\\">Amazon Black Friday page</a></p><p><a href=\\\"http://www.argos.co.uk/static/ArgosPromo3/includeName/black-friday.htm\\\" rel=\\\"nofollow\\\">Argos Black Friday page</a></p><p><a href=\\\"http://www.very.co.uk/black-friday