/669/s/402719aa/sc/36/rc/3/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597198363/u/49/f/415074/c/669/s/402719aa/sc/36/rc/3/rc.img\\\" /></a><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597198363/u/49/f/415074/c/669/s/402719aa/sc/36/a2.htm\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597198363/u/49/f/415074/c/669/s/402719aa/sc/36/a2.img\\\" /></a><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://pi.feedsportal.com/r/211597198363/u/49/f/415074/c/669/s/402719aa/sc/36/a2t.img\\\" width=\\\"1\\\" /><img height=\\\"1\\\" src=\\\"http://feeds.feedburner.com/~r/techradar/computing-news/~4/8uiH-HybjIk\\\" width=\\\"1\\\" />\\\', \\\'guidislink\\\': False, \\\'title_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/plain\\\', \\\'value\\\': u\\\'Updated: Black Friday Deals UK 2014: get mega deals on tech this month\\\', \\\'language\\\': None}, \\\'link\\\': u\\\'http://feedproxy.google.com/~r/techradar/computing-news/~3/8uiH-HybjIk/story01.htm\\\', \\\'author\\\': u\\\'James Rivington\\\', \\\'published\\\': u\\\'Thu, 13 Nov 2014 19:00:00 GMT\\\', \\\'authors\\\': [{}], \\\'author_detail\\\': {\\\'name\\\': u\\\'James Rivington\\\'}, \\\'id\\\': u\\\'http://www.techradar.com/1271586\\\'}, {\\\'summary_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'<img alt=\\\"Nvidia\\\\\\\'s GRID game-streaming service will be free until June 2015\\\" src=\\\"http://cdn.mos.techradar.com/art/tablets/Nvidia/GRID_NV_SHIELD_Family_wController-470-75.jpg\\\" /><p>If you haven\\\\\\\'t had a chance to play around with it, I\\\\\\\'ll be the first to tell you: <a href=\\\"http://www.techradar.com/reviews/gaming/playstation-now-1213666/review\\\">PlayStation Now</a> is great. No download times, no storage space requirements, almost zero need for bleeding-edge specs - just whatever game you want when you want it. It\\\\\\\'s like Netflix for games, except you pay per title rather than one monthly fee.</p><p>But as cool as PlayStation Now is, Nvidia\\\\\\\'s about to one-up them with their completely free game-streaming service called GRID that\\\\\\\'s coming to <a href=\\\"http://www.techradar.com/reviews/gaming/handheld-consoles/nvidia-shield-review-1123463/review\\\">Nvidia Shield Portable</a> and<a href=\\\"http://www.techradar.com/reviews/pc-mac/tablets/nvidia-shield-tablet-1258255/review\\\"> Nvidia Shield Tablet</a> owners November 18. </p><p>GRID has been available in private testing here on the west coast since earlier this year, but Nvidia has only today confirmed that the 20-plus games will be available for free, to Shield owners around the world, until the service stops on June 30, 2015. </p><p>What games are on the docket? It\\\\\\\'s AAA titles, mostly. Batman: Arkham City, Borderlands, Borderlands 2, Psychonauts and Brutal Legend, with more games to be added every month. The selection won\\\\\\\'t start at the 100 or so titles that Sony has in its lineup but what\\\\\\\'s there is impressive.</p><p>Just like PlayStation Now, games are streamed from remote servers so you\\\\\\\'ll be playing games in full 1080p at 60 frames per second without any download time or the game taking up space on your hard drive. The only catch here is that the service will only work for Nvidia Shield owners. </p><p>GRID isn\\\\\\\'t the only thing Nvidia has up its sleeve for its tablet toters. The company also announced today that they\\\\\\\'re bringing <a href=\\\"http://www.techradar.com/reviews/pc-mac/software/operating-systems/android-5-0-lollipop-1271651/review\\\">Android 5.0 Lollipop</a> to the Shield Tablet on Nov. 18 and, starting today, the 32GB LTE version of the Shield Tablet will come with the \\\"Green Bundle,\\\" which includes digital downloads of Half-Life 2: Episode 1, Half-Life 2 and the original Portal.</p><ul><li>Haven\\\\\\\'t read our review of the <a href=\\\"http://www.techradar.com/reviews/pc-mac/tablets/nvidia-shield-tablet-1258255/review\\\">Nvidia Shield Tablet</a>? What are you waiting for?</li></ul><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://rss.feedsportal.com/c/669/f/415074/s/40728aca/sc/5/mf.gif\\\" width=\\\"1\\\" /><br clear=\\\"all\\\" /><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/1/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/1/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/2/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/2/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/3/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/3/rc.img\\\" /></a><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/a2.htm\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/a2.img\\\" /></a><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://pi.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/a2t.img\\\" width=\\\"1\\\" /><img height=\\\"1\\\" src=\\\"http://feeds.feedburner.com/~r/techradar/computing-news/~4/xLAM7YlSB6Y\\\" width=\\\"1\\\" />\\\', \\\'language\\\': None}, \\\'published_parsed\\\': time.struct_time(tm_year=2014, tm_mon=11, tm_mday=13, tm_hour=14, tm_min=0, tm_sec=0, tm_wday=3, tm_yday=317, tm_isdst=0), \\\'links\\\': [{\\\'href\\\': u\\\'http://feedproxy.google.com/~r/techradar/computing-news/~3/xLAM7YlSB6Y/story01.htm\\\', \\\'type\\\': u\\\'text/html\\\', \\\'rel\\\': u\\\'alternate\\\'}], \\\'title\\\': u\\\"Nvidia\\\'s GRID game-streaming service will be free until June 2015\\\", \\\'feedburner_origlink\\\': u\\\'http://rss.feedsportal.com/c/669/f/415074/s/40728aca/sc/5/l/0L0Stechradar0N0Cnews0Cgaming0Cnvidia0Es0Egrid0Egame0Estreaming0Eservice0Ewill0Ebe0Efree0Euntil0Ejune0E20A150E12728250Dsrc0Frss0Gattr0Fall/story01.htm\\\', \\\'tags\\\': [{\\\'term\\\': u\\\'Computing, Gaming, Mobile computing\\\', \\\'scheme\\\': None, \\\'label\\\': None}], \\\'summary\\\': u\\\'<img alt=\\\"Nvidia\\\\\\\'s GRID game-streaming service will be free until June 2015\\\" src=\\\"http://cdn.mos.techradar.com/art/tablets/Nvidia/GRID_NV_SHIELD_Family_wController-470-75.jpg\\\" /><p>If you haven\\\\\\\'t had a chance to play around with it, I\\\\\\\'ll be the first to tell you: <a href=\\\"http://www.techradar.com/reviews/gaming/playstation-now-1213666/review\\\">PlayStation Now</a> is great. No download times, no storage space requirements, almost zero need for bleeding-edge specs - just whatever game you want when you want it. It\\\\\\\'s like Netflix for games, except you pay per title rather than one monthly fee.</p><p>But as cool as PlayStation Now is, Nvidia\\\\\\\'s about to one-up them with their completely free game-streaming service called GRID that\\\\\\\'s coming to <a href=\\\"http://www.techradar.com/reviews/gaming/handheld-consoles/nvidia-shield-review-1123463/review\\\">Nvidia Shield Portable</a> and<a href=\\\"http://www.techradar.com/reviews/pc-mac/tablets/nvidia-shield-tablet-1258255/review\\\"> Nvidia Shield Tablet</a> owners November 18. </p><p>GRID has been available in private testing here on the west coast since earlier this year, but Nvidia has only today confirmed that the 20-plus games will be available for free, to Shield owners around the world, until the service stops on June 30, 2015. </p><p>What games are on the docket? It\\\\\\\'s AAA titles, mostly. Batman: Arkham City, Borderlands, Borderlands 2, Psychonauts and Brutal Legend, with more games to be added every month. The selection won\\\\\\\'t start at the 100 or so titles that Sony has in its lineup but what\\\\\\\'s there is impressive.</p><p>Just like PlayStation Now, games are streamed from remote servers so you\\\\\\\'ll be playing games in full 1080p at 60 frames per second without any download time or the game taking up space on your hard drive. The only catch here is that the service will only work for Nvidia Shield owners. </p><p>GRID isn\\\\\\\'t the only thing Nvidia has up its sleeve for its tablet toters. The company also announced today that they\\\\\\\'re bringing <a href=\\\"http://www.techradar.com/reviews/pc-mac/software/operating-systems/android-5-0-lollipop-1271651/review\\\">Android 5.0 Lollipop</a> to the Shield Tablet on Nov. 18 and, starting today, the 32GB LTE version of the Shield Tablet will come with the \\\"Green Bundle,\\\" which includes digital downloads of Half-Life 2: Episode 1, Half-Life 2 and the original Portal.</p><ul><li>Haven\\\\\\\'t read our review of the <a href=\\\"http://www.techradar.com/reviews/pc-mac/tablets/nvidia-shield-tablet-1258255/review\\\">Nvidia Shield Tablet</a>? What are you waiting for?</li></ul><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://rss.feedsportal.com/c/669/f/415074/s/40728aca/sc/5/mf.gif\\\" width=\\\"1\\\" /><br clear=\\\"all\\\" /><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/1/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/1/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/2/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/2/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/3/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/rc/3/rc.img\\\" /></a><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/a2.htm\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/a2.img\\\" /></a><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://pi.feedsportal.com/r/211597548643/u/49/f/415074/c/669/s/40728aca/sc/5/a2t.img\\\" width=\\\"1\\\" /><img height=\\\"1\\\" src=\\\"http://feeds.feedburner.com/~r/techradar/computing-news/~4/xLAM7YlSB6Y\\\" width=\\\"1\\\" />\\\', \\\'guidislink\\\': False, \\\'title_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/plain\\\', \\\'value\\\': u\\\"Nvidia\\\'s GRID game-streaming service will be free until June 2015\\\", \\\'language\\\': None}, \\\'link\\\': u\\\'http://feedproxy.google.com/~r/techradar/computing-news/~3/xLAM7YlSB6Y/story01.htm\\\', \\\'author\\\': u\\\'Nick Pino\\\', \\\'published\\\': u\\\'Thu, 13 Nov 2014 14:00:00 GMT\\\', \\\'authors\\\': [{}], \\\'author_detail\\\': {\\\'name\\\': u\\\'Nick Pino\\\'}, \\\'id\\\': u\\\'http://www.techradar.com/1272825\\\'}, {\\\'summary_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'<img alt=\\\"Tech Bargains: TechRadar Deals: Samsung Galaxy Tab Pro, speakers, chargers and more!\\\" src=\\\"http://cdn.mos.techradar.com/art/techradar/TechRadar%20Deals/13th%20Nov%2014/maindealpic-470-75.jpg\\\" /><p>As usual, our team of deal elves have been working through the night to bring you today\\\\\\\'s best tech deals. And today we\\\\\\\'ve got some exclusive bargains for you!</p><p>Not only can you save \\\\xa330 on the excellent 8.4-inch Samsung Galaxy Tab PRO