/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/rc/1/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/rc/1/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/rc/2/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/rc/2/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/rc/3/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/rc/3/rc.img\\\" /></a><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/a2.htm\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/a2.img\\\" /></a><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://pi.feedsportal.com/r/211597521066/u/49/f/415074/c/669/s/40675c4a/sc/28/a2t.img\\\" width=\\\"1\\\" /><img height=\\\"1\\\" src=\\\"http://feeds.feedburner.com/~r/techradar/computing-news/~4/nGeO5rBatJA\\\" width=\\\"1\\\" />\\\', \\\'guidislink\\\': False, \\\'title_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/plain\\\', \\\'value\\\': u\\\'Tech Bargains: TechRadar Deals: Destiny for PS4, pool tables, USB hard drives and more!\\\', \\\'language\\\': None}, \\\'link\\\': u\\\'http://feedproxy.google.com/~r/techradar/computing-news/~3/nGeO5rBatJA/story01.htm\\\', \\\'author\\\': u\\\'Deal Young\\\', \\\'published\\\': u\\\'Wed, 12 Nov 2014 11:50:00 GMT\\\', \\\'authors\\\': [{}], \\\'author_detail\\\': {\\\'name\\\': u\\\'Deal Young\\\'}, \\\'id\\\': u\\\'http://www.techradar.com/1272703\\\'}, {\\\'summary_detail\\\': {\\\'base\\\': u\\\'http://feeds.feedburner.com/techradar/computing-news?format=xml\\\', \\\'type\\\': u\\\'text/html\\\', \\\'value\\\': u\\\'<img alt=\\\"Tech Bargains: TechRadar Deals: Roku Streaming Stick, cheap Blu-ray movies + Call of Duty!\\\" src=\\\"http://cdn.mos.techradar.com/art/techradar/TechRadar%20Deals/11th%20Nov%2014/deal%20main%20pic-470-75.jpg\\\" /><p>TechRadar Deals are put together each day to save you money, and today we\\\\\\\'ve found some excellent deals you might find irresistible.</p><p>Why don\\\\\\\'t we kick off with a couple of superb deals on Blu-ray movies? Firstly we\\\\\\\'ve spotted the <a href=\\\"http://www.amazon.co.uk/Frozen-Blu-ray-Region-Free-Kristen/dp/B00FZLFST2?ie=UTF8&#38;tag=futurepublish_trd_deals-21\\\">Frozen Blu-ray disc on Amazon for just \\\\xa310</a> - if your young kids don\\\\\\\'t have this it\\\\\\\'s surely a must-buy.</p><p>And if you\\\\\\\'re a Tolkien fan we\\\\\\\'ve uncovered a bargain just for you - <a href=\\\"http://www.rakuten.co.uk/shop/the-entertainment-store/product/1000449855/\\\">The Hobbit: The Desolation of Smaug for just \\\\xa35</a>! The standard price for this one is \\\\xa310 so be sure to add the secret discount code when checking out - that code is <strong>SPEND10</strong>.</p><p><img alt=\\\"roku\\\" src=\\\"http://mos.futurenet.com/techradar/art/techradar/TechRadar%20Deals/11th%20Nov%2014/1roku-580-100.jpg\\\" width=\\\"580\\\" /></p><p>Want a cheap and easy way to get superb smart features on an HD TV that doesn\\\\\\\'t have Netflix and BBC iPlayer already built in? The excellent Roku Streaming Stick is a little dongle that plugs directly into your TV\\\\\\\'s HDMI port and adds hundreds of smart apps for your viewing pleasure. <a href=\\\"http://www.amazon.co.uk/dp/B00K71I68K/?ie=UTF8&#38;tag=futurepublish_trd_deals-21\\\">And you can get it on Amazon right now for just \\\\xa339</a>!</p><p><img alt=\\\"cod\\\" src=\\\"http://mos.futurenet.com/techradar/art/techradar/TechRadar%20Deals/11th%20Nov%2014/3cod-580-100.jpg\\\" width=\\\"580\\\" /></p><p>Heads up PS4 gamers. If you\\\\\\\'re keen to play the new Call of Duty, <a href=\\\"http://deals.simplygames.com/p/call-of-duty-advanced-warfare-ps4\\\">Advanced Warfare can currently be had for just \\\\xa334.85 over on Simply Games</a> and that includes free delivery.</p><p><img alt=\\\"wireless mouse\\\" src=\\\"http://mos.futurenet.com/techradar/art/techradar/TechRadar%20Deals/11th%20Nov%2014/2anker-580-100.jpg\\\" width=\\\"580\\\" /></p><p>If your laptop\\\\\\\'s trackpad is driving you mad, you really ought to bite the bullet and buy a wireless mouse. It makes using a laptop so much easier if you\\\\\\\'ve got the space and this <a href=\\\"http://www.amazon.co.uk/Full-Size-Ergonomic-Wireless-Buttons-Adjustment/dp/B00B0TXEEY?ie=UTF8&#38;tag=futurepublish_trd_deals-21\\\">full size ergonomic mouse is currently on Amazon for just \\\\xa310</a>. No brainer!</p><p><img alt=\\\"duronic\\\" src=\\\"http://cdn0.mos.techradar.futurecdn.net//art/techradar/TechRadar%20Deals/10th%20Nov%2014/3plugs-580-100.jpg\\\" width=\\\"580\\\" /></p><p>If you\\\\\\\'re planning on picking up a new TV, games consoles or any other gadgets before Christmas, you might also need a new power extension? The <a href=\\\"http://www.amazon.co.uk/Duronic-ST10B-Extension-Engineered-protected/dp/B000OV0CEY/?ie=UTF8&#38;tag=futurepublish_trd_deals-21\\\">Duronic ST10B 10-socket 2-metre extension is now just \\\\xa36.99 on Amazon</a>.</p><p><img alt=\\\"thermos\\\" src=\\\"http://mos.futurenet.com/techradar/art/techradar/TechRadar%20Deals/11th%20Nov%2014/thermo%20flask-580-100.jpg\\\" width=\\\"580\\\" /></p><p>And finally, with winter setting in one of the best ways to keep warm on the way to work is to take a brew with you. <a href=\\\"http://www.amazon.co.uk/gp/offer-listing/B000TAU60U?ie=UTF8&#38;tag=futurepublish_trd_deals-21\\\">This 350ml Thermos is just \\\\xa33 on Amazon right now</a>! Don\\\\\\\'t be the one to arrive in the office with blue fingers!</p><h3>MORE DEALS</h