/16 CareTouch Wet and Dry Shaver <a href=\\\"http://www.argos.co.uk/static/Product/partNumber/2484363.htm\\\">for \\\\xa347.99 @ Argos</a></p><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://rss.feedsportal.com/c/669/f/415074/s/406022be/sc/23/mf.gif\\\" width=\\\"1\\\" /><br clear=\\\"all\\\" /><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/rc/1/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/rc/1/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/rc/2/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/rc/2/rc.img\\\" /></a><br /><a href=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/rc/3/rc.htm\\\" rel=\\\"nofollow\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/rc/3/rc.img\\\" /></a><br /><br /><a href=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/a2.htm\\\"><img border=\\\"0\\\" src=\\\"http://da.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/a2.img\\\" /></a><img border=\\\"0\\\" height=\\\"1\\\" src=\\\"http://pi.feedsportal.com/r/211597461763/u/49/f/415074/c/669/s/406022be/sc/23/a2t.img\\\" width=\\\"1\\\" /><img height=\\\"1\\\" src=\\\"http://feeds.feedburner.com/~r/techradar/computing-news/~4/j071XBR7P0E\\\" width=\\\"1\\\" />\\\', \\\'language\\\': None}, \\\'published_parsed\\\': time.struct_time(tm_year=2014, tm_mon=11, tm_mday=11, tm_hour=10, tm_min=32, tm_sec=0, tm_wday=1, tm_yday=315, tm_isdst=0), \\\'links\\\': [{\\\'href\\\': u\\\'http://feedproxy.google.com/~r/techradar/computing-news/~3/j071XBR7P0E/story01.htm\\\', \\\'type\\\': u\\\'text/html\\\', \\\'rel\\\': u\\\'alternate\\\'}], \\\'title\\\':